  if (response_body_raw.includes('<html>')) {
    done({
        "response_body_raw": "Failed to Refresh Token ... Something went wrong",
        "response_status_code": 502
    });
  } else {
    done();
  }
}
else {
    let configs = {};
    let body = response_body_map || response_body;
    if (body.refresh_token) {
        configs['oauth.user.refresh_token'] = body.refresh_token;
    }
    if (body.access_token) {
        configs['oauth.user.token'] = body.access_token;
    }
    configs['oauth.user.refresh_time'] = new Date().getTime();
    configs['oauth.user.refresh_interval'] = '570';
    done({
        "configuration": configs
    });
}

